import React from 'react'
import "./Header.css";
import { connect } from "react-redux";

const mapStateToProps = (state) => ({
    state
});

function Header(props) {

    return (
        <header>
            <div className="container h-flex">
                <h2>{props.state.training.status}</h2>
            </div>
        </header>
    )
}

export default connect(
    mapStateToProps,
    null,
)(Header);
